export default async function handler(req, res) {
  if (req.method === "PATCH") {
    const { id } = req.query;
    const { status } = req.body;
    try {
      const { changes } = await run(
        `UPDATE todos SET status = ? WHERE id = ?`,
        [status, id]
      );
      if (changes === 0) {
        res.status(404).json({ error: "Eintrag nicht gefunden" });
