import fs from "fs";
import path from "path";
import sqlite3 from "sqlite3";

/* Ensure data directory exists */
const dataDir = path.resolve(process.cwd(), "data");
if (!fs.existsSync(dataDir)) {
  fs.mkdirSync(dataDir, { recursive: true });
}

/* Path to the SQLite file */
const DB_PATH = path.join(dataDir, "database.sqlite");

/* Singleton DB instance */
let _db = null;

/**
 * Initialise the database (create tables if they do not exist)
 */
function initSchema(db) {
  const createTableSQL = `
    CREATE TABLE IF NOT EXISTS todos (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      nr INTEGER NOT NULL,
      name TEXT NOT NULL,
      beschreibung TEXT,
      status TEXT NOT NULL CHECK (status IN ('offen', 'in Arbeit', 'erledigt'))
    );
    CREATE INDEX IF NOT EXISTS idx_nr ON todos (nr);
    CREATE INDEX IF NOT EXISTS idx_status ON todos (status);
  `;
  db.exec(createTableSQL, err => {
    if (err) console.error("Failed to initialise DB schema:", err);
  });
}

/**
 * Get (or create) the SQLite database connection.
 */
export function getDB() {
  if (_db) return _db;

  sqlite3.verbose();
  _db = new sqlite3.Database(DB_PATH, sqlite3.OPEN_READWRITE | sqlite3.OPEN_CREATE, err => {
    if (err) {
      console.error("Unable to open SQLite DB:", err);
    } else {
      initSchema(_db);
    }
  });

  // Enforce foreign keys
  _db.run("PRAGMA foreign_keys = ON");
  return _db;
}

/**
 * Run a statement that does not return rows (INSERT/UPDATE/DELETE).
 * Returns a Promise that resolves with { lastID, changes }.
 */
export function run(sql, params = []) {
  const db = getDB();
  return new Promise((resolve, reject) => {
    db.run(sql, params, function (err) {
      if (err) return reject(err);
      resolve({ lastID: this.lastID, changes: this.changes });
    });
  });
}

/**
 * Retrieve a single row.
 */
export function get(sql, params = []) {
  const db = getDB();
  return new Promise((resolve, reject) => {
    db.get(sql, params, (err, row) => {
      if (err) return reject(err);
      resolve(row);
    });
  });
}

/**
 * Retrieve all rows.
 */
export function all(sql, params = []) {
  const db = getDB();
  return new Promise((resolve, reject) => {
    db.all(sql, params, (err, rows) => {
      if (err) return reject(err);
      resolve(rows);
    });
  });
}

/**
 * Close the DB connection (used in tests / graceful shutdown).
 */
export function close() {
  const db = getDB();
  return new Promise((resolve, reject) => {
    db.close(err => {
      if (err) return reject(err);
      _db = null;
      resolve();
    });
  });
}
